import { SettingDecoratorConverter } from 'src/app/_base/decorators/setting.decorator';

interface DataSetsNgModelRecordFormat {
    id : string;
    name : string;
    datasets : string;
}

type DataSetsNgModelType = DataSetsNgModelRecordFormat[];

interface DataSetsStoreRecordFormat {
    id : string;
    name : string;
    datasets : string[];
}

type DataSetsStoreType = DataSetsStoreRecordFormat[];

export class DataSetsSettingDecoratorConverter 
    implements SettingDecoratorConverter<DataSetsNgModelType, DataSetsStoreType> 
{
    modelConversion(content : DataSetsNgModelType) : DataSetsStoreType {
        return content.map((x) => {
            let row : DataSetsStoreRecordFormat
        })
        // let result : DataSetsStoreRecordFormat[] = [];
        // for (let i=0; i<content.length; i++) {
        //     result[i]['id'] = content[i]['id'];
        //     result[i]['name'] = content[i]['name'];
        //     result[i]['datasets'] = content[i]['datasets'].trim().split('\n').map((x) => x.trim());
        // }
        // return result;
    }

    storeConversion(content : DataSetsStoreRecordFormat[]) : DataSetsNgModelRecordFormat[] {
        let result : DataSetsNgModelRecordFormat[] = [];
        console.log("data-sets-decorator-converter");
        console.log(result);
        console.log(result[0]);
        for (let i=0; i<content.length; i++) {
            result[i]['id'] = content[i]['id'];
            result[i]['name'] = content[i]['name'];
            result[i]['datasets'] = content[i]['datasets'].join('\n');
        }
        return result;
    }
}
